def func(nums, k):
    """
    Given lists of sorted and distinct integers, find the top k integers that occur most frequently.

    Args:
    nums: A list of lists of integers.
    k: An integer.

    Returns:
    A list of integers.
    """

    # Create a dictionary to store the frequency of each integer.
    freq = {}
    for num_list in nums:
        for num in num_list:
            if num not in freq:
                freq[num] = 0
            freq[num] += 1

    # Create a heap to store the top k integers with the highest frequency.
    heap = []
    for num, count in freq.items():
        if len(heap) < k:
            heapq.heappush(heap, (count, num))
        else:
            if count > heap[0][0]:
                heapq.heappop(heap)
                heapq.heappush(heap, (count, num))

    # Return the top k integers from the heap.
    result = []
    while heap:
        count, num = heapq.heappop(heap)
        result.append(num)

    return result

