def count_binary_seq(n):
    mod = 10**9 + 7
    dp = [[[-1 for k in range(n + 1)] for j in range(n + 1)] for i in range(n + 1)]
    def solve(i, sum_left, sum_right):
        if i == 2 * n:
            if sum_left == sum_right:
                return 1
            return 0

        if dp[i][sum_left][sum_right] != -1:
            return dp[i][sum_left][sum_right]

        ans = (solve(i + 1, sum_left, sum_right) % mod + solve(i + 1, sum_left + 1, sum_right) % mod + solve(i + 1, sum_left, sum_right + 1) % mod) % mod
        dp[i][sum_left][sum_right] = ans
        return ans

    return solve(0, 0, 0)

