def max_sum_increasing_subseq(a: List[int], n: int, index: int, k: int) -> int:
    """
    // function to find the maximum sum of increasing subsequence from prefix till ith index and also including a given kth element which is after i, i.e., k > i .
    // Available, imported libraries: math, re, heapq, bisect
    """

    # dp[i][j] stores the maximum sum of increasing subsequence from prefix till ith index and also including jth element.
    dp = [[0] * (n + 1) for _ in range(n + 1)]

    # Iterating over all the elements of the array.
    for i in range(1, n + 1):

        # Iterating over all the elements of the array.
        for j in range(1, n + 1):

            # If the jth element is greater than the ith element, then we can include it in the increasing subsequence.
            if j > i and a[j - 1] > a[i - 1]:
                dp[i][j] = max(dp[i - 1][j], dp[i - 1][i] + a[j - 1])

            # Otherwise, we cannot include it in the increasing subsequence.
            else:
                dp[i][j] = dp[i - 1][j]

    # Returning the maximum sum of increasing subsequence from prefix till nth index and also including kth element.
    return dp[n][k]

