    """
    Given an integer, return the integer after setting the left most unset bit.
    """
    # If n is 0, return 1.
    if n == 0:
        return 1

    # Find the left most unset bit.
    i = 0
    while (n & (1 << i)) != 0:
        i += 1

    # Set the left most unset bit.
    return n | (1 << i)

