def smallest_missing(A, left_element, right_element):
  """Finds the smallest missing element in a sorted array.

  Args:
    A: A sorted array of integers.
    left_element: The leftmost element of the array to search.
    right_element: The rightmost element of the array to search.

  Returns:
    The smallest missing element in the array.
  """

  # Check if the array is empty.
  if left_element > right_element:
    return left_element

  # Find the middle element of the array.
  mid = (left_element + right_element) // 2

  # Check if the middle element is missing.
  if A[mid] != mid:
    return mid

  # Check if the missing element is in the left half of the array.
  if A[mid] == left_element:
    return smallest_missing(A, left_element, mid - 1)

  # Check if the missing element is in the right half of the array.
  else:
    return smallest_missing(A, mid + 1, right_element)

