def lcs_of_three(X, Y, Z, m, n, o):
    """
    :param X: the first string
    :param Y: the second string
    :param Z: the third string
    :param m: the length of the first string
    :param n: the length of the second string
    :param o: the length of the third string
    :return: the length of the longest common subsequence of the three strings
    """
    # create a 3D array to store the lengths of the longest common subsequences
    # of the first i characters of X, the first j characters of Y, and the first k characters of Z
    lcs = [[[0 for i in range(o + 1)] for j in range(n + 1)] for i in range(m + 1)]

    # fill in the first row and column of the 3D array with zeros
    for i in range(m + 1):
        for j in range(n + 1):
            lcs[i][j][0] = 0
    for i in range(m + 1):
        for k in range(o + 1):
            lcs[i][0][k] = 0
    for j in range(n + 1):
        for k in range(o + 1):
            lcs[0][j][k] = 0

    # fill in the rest of the 3D array
    for i in range(1, m + 1):
        for j in range(1, n + 1):
            for k in range(1, o + 1):
                if X[i - 1] == Y[j - 1] and X[i - 1] == Z[k - 1]:
                    lcs[i][j][k] = lcs[i - 1][j - 1][k - 1] + 1
                else:
                    lcs[i][j][k] = max(lcs[i - 1][j][k], lcs[i][j - 1][k], lcs[i][j][k - 1])

    # return the length of the longest common subsequence of the three strings
    return lcs[m][n][o]

