def check_min_heap(arr, i):

    # base case: if index i is greater than or equal to the length of the array, the array is a min heap
    if i >= len(arr):
        return True

    # check if the left and right child of the current node are greater than or equal to the current node
    left_child = 2 * i + 1
    right_child = 2 * i + 2

    if left_child < len(arr) and arr[left_child] >= arr[i]:
        return False
    if right_child < len(arr) and arr[right_child] >= arr[i]:
        return False

    # recursively check the left and right subtrees
    return check_min_heap(arr, left_child) and check_min_heap(arr, right_child)

