def maximum_product(nums):
    """
    Computes the maximum product of three numbers of a given array of integers using heap queue algorithm.

    Args:
       nums: A list of integers.

    Returns:
       The maximum product of three numbers in the given list of integers.
    """

    # Create a heap of the three smallest negative numbers in the list.
    neg_heap = []
    for num in nums:
        if num < 0:
            heapq.heappush(neg_heap, num)
            if len(neg_heap) > 3:
                heapq.heappop(neg_heap)

    # Create a heap of the three largest positive numbers in the list.
    pos_heap = []
    for num in nums:
        if num > 0:
            heapq.heappush(pos_heap, -num)
            if len(pos_heap) > 3:
                heapq.heappop(pos_heap)

    # Compute the maximum product of three numbers.
    max_product = 1
    if len(neg_heap) == 3:
        max_product *= heapq.heappop(neg_heap) * heapq.heappop(neg_heap) * heapq.heappop(neg_heap)
    elif len(neg_heap) == 2:
        max_product *= heapq.heappop(neg_heap) * heapq.heappop(neg_heap) * heapq.heappop(pos_heap)
    else:
        max_product *= heapq.heappop(pos_heap) * heapq.heappop(pos_heap) * heapq.heappop(pos_heap)

    return max_product

