def coin_change(S, m, n):

    # initialize the dp table
    dp = [[0 for x in range(n+1)] for x in range(m+1)]

    # fill the dp table in bottom-up manner
    for i in range(m+1):
        for j in range(n+1):
            # base cases
            if i == 0:
                dp[i][j] = 0
            if j == 0:
                dp[i][j] = 1

            # if the coin value is greater than the amount
            elif S[i-1] > j:
                dp[i][j] = dp[i-1][j]

            # if the coin value is less than or equal to the amount
            else:
                dp[i][j] = dp[i-1][j] + dp[i][j-S[i-1]]

    # return the result
    return dp[m][n]

